import React from "react";
import { Paper, Divider, } from "@material-ui/core";
import Grid from "@material-ui/core/Grid";
import { makeStyles , MuiThemeProvider } from "@material-ui/core/styles";
import Typography from "@material-ui/core/Typography";
import { storiesOf } from "@storybook/react";
import themes from "../../Theme/themes";
import { BrandType } from "../../types/brand";
import FlightCard from "../FlightCard";

const useStyles = makeStyles((theme) => ({
    root: {
        background: theme.palette.background.default,
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
    darkBg: {
        background: "rgba(0, 0, 0, 0.6)",
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
}));

type FlightCardStoryProps = {
    mode: string,
    brand: BrandType,
    legs: string[]
}

const FlightCardStory = ({
    mode, brand, legs
}: FlightCardStoryProps) => {
    const classes = useStyles(themes[brand]);

    return (
        <MuiThemeProvider theme={themes[brand]}>
            <Paper className={classes[mode]} id="FlightCard">
                <Typography variant="h3">FlightCard</Typography>
                <br />
                <Divider />
                <br />
                <Grid>
                    <FlightCard 
                        onChangeFlights={() => {}} 
                        legs={legs}
                        pax="2"
                    />
                </Grid>
            </Paper>
        </MuiThemeProvider>

    );
};

const mockLegs = [
    {
        cia: "latam",
        date: "qui, 10 de out",
        class: "Classe Executiva",
        departure: "22:40",
        departureIata: "GRU",
        arrival: "00:50",
        arrivalIata: "BCN",
        luggage: {
            handBaggageQuantity: 1,
            checkedBaggageQuantity: 1
        },
        stops: 1,
        duration: "1h 10min",
        issuerCia: "JJ"
    },
    {
        cia: "latam",
        date: "qui, 10 de out",
        class: "Classe Executiva",
        departure: "22:40",
        departureIata: "BCN",
        arrival: "00:50",
        arrivalIata: "GRU",
        luggage: {
            handBaggageQuantity: 0,
            checkedBaggageQuantity: 0
        },
        stops: 0,
        duration: "1h 10min",
        issuerCia: "JJ"
    },
]

const argsControls = {
    args: {
        brand: "CVC",
        mode: "root",
        legs: mockLegs
    },
    argTypes: {
        brand: {
            type: "select",
            options: ["BlackAndWhite", "BlackFriday", "CVC", "CVCCorp", "CVCYellow", "Sub"]
        },
        mode: {
            type: "select",
            options: ["root", "darkBg"]
        },
        legs: {
            type: "array"
        }
    }
}

storiesOf("Components/FlightCard", module).addParameters({ storySource: { source: __STORY__, locationsMap: __LOCATIONS_MAP__ } })
    .add("Default", (args) => <FlightCardStory {...args}/>, argsControls);
